import Inputs from "../../shared/Components/FormElements/Input";
import './NewPlace.css';

const NewPlace = props => {
    return(
        <form className="place-form">
          <Inputs inputfieldtype="input" label="Title" type="text" errorText="Please enter a valid title"/>
          <Inputs label="Description" type="text" errorText="Please enter a valid description"/>
          <button type="submit">Add Place</button>
        </form>

    );
}

export default NewPlace;
